package constructorstudy;

public class CS2 {
     
	public static void CS2() {
		int a=64;
		int b=8;
		double c=a/b;
		System.out.println(c);
	}
	
	public static void CS2(int i,int j) {
		int k=i*j;
		System.out.println(k);
		
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
      CS2();
      CS2(5,6);
	}

}
